T</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>165</id>\n  <type>COUNT</type>\n  <cohortDefinition id=\"9\">\n    <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition\" id=\"10\" uuid=\"2d0d32d7-d69d-40eb-92b2-096c0b7dd1dd\"/>\n    <parameterMappings id=\"11\">\n      <entry>\n        <string>onOrBefore</string>\n        <string>${endDate}</string>\n      </entry>\n      <entry>\n        <string>locationList</string>\n        <string>${location}</string>\n      </entry>\n      <entry>\n        <string>onOrAfter</string>\n        <string>${startDate}</string>\n      </entry>\n    </parameterMappings>\n  </cohortDefinition>\n</org.openmrs.module.reporting.indicator.CohortIndicator>','2012-03-14 14:20:43',1010,'2012-03-14 14:21:18',1010,0,NULL,NULL,NULL,'67842749-6e4b-49b7-ae6c-005e0e6e3c47'),(166,'_Primary care non-coded diagnoses','Show the non-coded diagnoses along with the frequency.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"9c03f7bb-ff31-4d49-acec-02e31a2dfd0a\" retired=\"false\">\n  <name>_Primary care non-coded diagnoses</name>\n  <description>Show the non-coded diagnoses along with the frequency.</description>\n  <dateCreated id=\"2\">2012-03-26 12:07:46 EDT</dateCreated>\n  <dateChanged id=\"3\">2012-03-26 17:20:46 EDT</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>166</id>\n  <sqlQuery>select distinct(upper(o.value_text)) as &apos;Diagnosis, non-coded&apos;, count(*) as Count &#xd;\n  from obs o, encounter e &#xd;\n where o.concept_id = 6543 &#xd;\n   and o.value_text is not null&#xd;\n   and o.obs_datetime &gt;= :startDate&#xd;\n   and o.obs_datetime &lt;= :endDate&#xd;\n   and o.voided = 0&#xd;\n   and e.encounter_id = o.encounter_id&#xd;\n   and e.location_id = :location &#xd;\n group by o.value_text &#xd;\n order by count(*) desc;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-26 12:07:46',1,'2013-02-27 11:14:42',1,0,NULL,NULL,NULL,'9c03f7bb-ff31-4d49-acec-02e31a2dfd0a'),(167,'_Primary care visits with diagnoses','By Ellen and row per patient data with patient name, id, diagnoses and creator.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"180da908-7143-4f5e-9fd9-d026df83b2a0\" retired=\"false\">\n  <name>_Primary care visits with diagnoses</name>\n  <description>By Ellen and row per patient data with patient name, id, diagnoses and creator.</description>\n  <dateCreated id=\"2\">2012-03-26 12:34:35 EDT</dateCreated>\n  <dateChanged id=\"3\">2012-04-20 09:08:03 EDT</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>167</id>\n  <sqlQuery>SELECT pr.uuid &apos;Internal ID&apos;, &#xd;\n       zl.identifier &apos;ZL ID&apos;,&#xd;\n       concat(pn.given_name, &apos; &apos;, pn.family_name) &apos;Patient name&apos;,&#xd;\n       e.encounter_id, &#xd;\n       date(e.encounter_datetime) as &apos;Visit date&apos;, &#xd;\n       cn.name Diagnosis, nc.value_text &apos;Diagnosis, non coded&apos;, &#xd;\n       concat(upn.given_name, &apos; &apos;, upn.family_name,&apos; [&apos;, u.username, &apos;]&apos;)&#xd;\n         as &apos;User name&apos;&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN &#xd;\n  (SELECT patient_id, identifier &#xd;\n     FROM patient_identifier &#xd;\n    WHERE voided = 0 &#xd;\n      AND identifier_type = 8 &#xd;\n    ORDER BY date_created DESC) zl&#xd;\n ON p.patient_id = zl.patient_id&#xd;\n&#xd;\nINNER JOIN person_name pn&#xd;\n   ON p.patient_id = pn.person_id&#xd;\n&#xd;\nINNER JOIN encounter e &#xd;\n   ON p.patient_id = e.patient_id &#xd;\n  AND e.encounter_type = 19&#xd;\n  and e.location_id = :location &#xd;\n  AND e.voided = 0 &#xd;\n  and date(e.encounter_datetime) BETWEEN :startDate AND addDate(:endDate,1)&#xd;\n&#xd;\nINNER JOIN users u&#xd;\n   ON e.creator = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name upn&#xd;\n   ON u.person_id = upn.person_id&#xd;\n&#xd;\nLEFT OUTER JOIN obs c &#xd;\n  ON e.encounter_id = c.encounter_id &#xd;\n AND c.concept_id = 6542 &#xd;\n AND c.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cn&#xd;\n  ON c.value_coded = cn.concept_id &#xd;\n AND cn.locale = &apos;ht&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name_tag_map cntm&#xd;\n   ON cn.concept_name_id = cntm.concept_name_id&#xd;\n and cntm.concept_name_tag_id = 4 &#xd;\n&#xd;\nLEFT OUTER JOIN obs nc &#xd;\n  ON e.encounter_id = nc.encounter_id&#xd;\n AND nc.concept_id = 6543&#xd;\n AND nc.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY e.encounter_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-26 12:34:35',1,'2013-02-27 11:13:59',1,0,NULL,NULL,NULL,'180da908-7143-4f5e-9fd9-d026df83b2a0'),(168,'_Patient care diagnosis quality report','Patient visit quality report shows patient name, ZL EMR id, diagnoses and username, along with a list of non-coded diagnoses','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"f1e504f7-ac84-420e-a8c7-947f55ad578f\" retired=\"false\">\n  <name>_Patient care diagnosis quality report</name>\n  <description>Patient visit quality report shows patient name, ZL EMR id, diagnoses and username, along with a list of non-coded diagnoses</description>\n  <dateCreated id=\"2\">2012-03-26 16:33:41 EDT</dateCreated>\n  <dateChanged id=\"3\">2012-04-19 15:47:30 EDT</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>168</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>primaryCareVisitDiagnosis</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"180da908-7143-4f5e-9fd9-d026df83b2a0\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>nonCodedDiagnoses</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"12\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"13\" uuid=\"9c03f7bb-ff31-4d49-acec-02e31a2dfd0a\"/>\n        <parameterMappings reference=\"11\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>serverName</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"14\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"15\" uuid=\"254fbbbf-6e9f-49aa-a3ec-8c5b042cde82\"/>\n        <parameterMappings id=\"16\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-26 16:33:41',1,'2013-02-27 11:15:04',1,0,NULL,NULL,NULL,'f1e504f7-ac84-420e-a8c7-947f55ad578f'),(172,'_Patient registration data quality','Patient registration data quality creates large spreadsheet with name, id, age, birthdate, user, address, etc. This report takes time to run (timed at 2+ minutes).','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"8926591c-73de-4c5d-8410-d6231699465c\" retired=\"false\">\n  <name>_Patient registration data quality</name>\n  <description>Patient registration data quality creates large spreadsheet with name, id, age, birthdate, user, address, etc. This report takes time to run (timed at 2+ minutes).</description>\n  <dateCreated id=\"2\">2012-03-30 15:22:41 EDT</dateCreated>\n  <dateChanged id=\"3\">2012-04-20 09:01:18 EDT</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>172</id>\n  <sqlQuery>SELECT &#xd;\n   pr.uuid as PatientID,&#xd;\n   zl.identifier as &apos;ZL_ID&apos;, &#xd;\n   date(reg.encounter_datetime) as RegDate, &#xd;\n   n.given_name as GivenName,   &#xd;\n   n.family_name as FamilyName,   &#xd;\n   pr.gender as Gender, &#xd;\n   pr.birthdate as Birthdate,    &#xd;\n   floor(DATEDIFF(reg.encounter_datetime, pr.birthdate)/365.25) as Age, &#xd;\n   a.state_province as Department, &#xd;\n   a.city_village as Commune, &#xd;\n   a.address3 as SectionCommunale,  &#xd;\n   a.address1 as Locality, &#xd;\n   a.address2 as Address, &#xd;\n   hierarchy.address_hierarchy_entry_id as HierarchyID, &#xd;\n   t.value as Telephone,  &#xd;\n   concat(un.given_name, &apos; &apos;, un.family_name, &#xd;\n          &apos; [&apos;, u.username, &apos;]&apos;) as User&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON p.patient_id = pr.person_id&#xd;\n&#xd;\n-- Patient name (n)&#xd;\nINNER JOIN &#xd;\n   (SELECT person_id, given_name, family_name &#xd;\n      FROM person_name &#xd;\n     WHERE voided = 0 &#xd;\n     ORDER BY date_created DESC) n &#xd;\n   ON p.patient_id = n.person_id&#xd;\n&#xd;\n-- ZL id (zl)&#xd;\nINNER JOIN &#xd;\n   (SELECT patient_id, identifier &#xd;\n      FROM patient_identifier &#xd;\n     WHERE voided = 0 &#xd;\n       AND identifier_type = 8&#xd;\n     ORDER BY date_created DESC) zl &#xd;\n   ON p.patient_id = zl.patient_id&#xd;\n&#xd;\n-- Registration encounter (reg)&#xd;\nINNER JOIN &#xd;\n  (SELECT patient_id, encounter_datetime, creator &#xd;\n     FROM encounter &#xd;\n    WHERE voided = 0 &#xd;\n      AND encounter_type = 12&#xd;\n      AND date(date_created) = :date &#xd;\n      AND location_id = :location&#xd;\n    ORDER BY encounter_datetime ASC) reg &#xd;\n  ON p.patient_id = reg.patient_id&#xd;\n&#xd;\n-- Address (a)&#xd;\nINNER JOIN &#xd;\n   (SELECT person_id,&#xd;\n           state_province, city_village, address3,  &#xd;\n           address1, address2  &#xd;\n      FROM person_address &#xd;\n     WHERE voided = 0 &#xd;\n     ORDER BY date_created DESC) a &#xd;\n   ON p.patient_id = a.person_id&#xd;\n&#xd;\n-- Telephone number (t)&#xd;\nLEFT OUTER JOIN person_attribute t &#xd;\n  ON p.patient_id = t.person_id &#xd;\n AND t.person_attribute_type_id = 10 &#xd;\n AND t.voided = 0&#xd;\n&#xd;\n-- Adddress hierarchy (hierarchy)&#xd;\nLEFT OUTER JOIN (&#xd;\n	SELECT &#xd;\n        l.address_hierarchy_entry_id, &#xd;\n        CONCAT(d.name, &apos;, &apos;, c.name, &apos;, &apos;, s.name,&#xd;\n               &apos;, &apos;, l.name) address&#xd;\n  	  FROM address_hierarchy_entry d&#xd;\n&#xd;\n	INNER JOIN &#xd;\n         address_hierarchy_entry c &#xd;\n         ON d.address_hierarchy_entry_id = c.parent_id &#xd;\n         AND c.level_id = 3&#xd;\n&#xd;\n	INNER JOIN &#xd;\n         address_hierarchy_entry s &#xd;\n         ON c.address_hierarchy_entry_id = s.parent_id&#xd;\n         AND s.level_id = 4&#xd;\n&#xd;\n	INNER JOIN &#xd;\n         address_hierarchy_entry l&#xd;\n         ON s.address_hierarchy_entry_id = l.parent_id&#xd;\n         AND l.level_id = 5&#xd;\n&#xd;\n	GROUP BY l.address_hierarchy_entry_id&#xd;\n	&#xd;\n	) hierarchy &#xd;\n   ON CONCAT(a.state_province, &apos;, &apos;,&#xd;\n             a.city_village, &apos;, &apos;,&#xd;\n             a.address3, &apos;, &apos;, &#xd;\n             a.address1) = hierarchy.address&#xd;\n&#xd;\n-- User (u) with Username (un)&#xd;\nINNER JOIN users u &#xd;\n   ON reg.creator = u.user_id&#xd;\nINNER JOIN person_name un &#xd;\n   ON u.person_id = un.person_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-30 15:22:41',1,'2013-02-27 11:19:35',1,0,NULL,NULL,NULL,'8926591c-73de-4c5d-8410-d6231699465c'),(173,'Numero Dossier Sequence Dataset','Numero Dossier Sequence Dataset','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"66daf666-beb0-4cc8-b697-24cd02702146\" retired=\"false\">  <name>Numero Dossier Sequence Dataset</name>  <description>Numero Dossier Sequence Dataset</description>    <dateCreated id=\"3\">2012-03-30 16:52:34 EDT</dateCreated>    <dateChanged id=\"5\">2012-04-12 18:09:40 EDT</dateChanged>  <parameters id=\"6\">    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">      <name>startDate</name>      <label>Start Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">      <name>endDate</name>      <label>End Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">      <name>locationId</name>      <label>Current Location</label>      <type>org.openmrs.Location</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>173</id>  <sqlQuery>select p.patient_id, &#xd;      (select max(identifier) &#xd;         from patient_identifier &#xd;        where patient_id = p.patient_id&#xd;          and identifier_type = 11&#xd;          and voided = 0) as numeroDossier&#xd;  from patient p, encounter e &#xd;where e.patient_id = p.patient_id &#xd;  and e.voided = 0&#xd;  and e.encounter_type = 13&#xd;  and e.location_id = :locationId &#xd;  and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;  and p.voided = 0&#xd;order by numeroDossier asc; </sqlQuery></org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-30 16:52:34',1086,'2012-04-14 10:44:34',1128,0,NULL,NULL,NULL,'66daf666-beb0-4cc8-b697-24cd02702146'),(174,'_Patient registration data quality','Patient registration data quality report with rows of encounters with patient ids, name, age, addresses, phone, etc.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d8851f73-9c11-4a75-8a9f-a254e725a97e\" retired=\"false\">\n  <name>_Patient registration data quality</name>\n  <description>Patient registration data quality report with rows of encounters with patient ids, name, age, addresses, phone, etc.</description>\n  <dateCreated id=\"2\">2012-04-02 16:36:25 EDT</dateCreated>\n  <dateChanged id=\"3\">2012-04-19 15:54:26 EDT</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>174</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>rowPerRegistrationEncounter</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" uuid=\"8926591c-73de-4c5d-8410-d6231699465c\"/>\n        <parameterMappings id=\"10\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>host</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"11\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"12\" uuid=\"254fbbbf-6e9f-49aa-a3ec-8c5b042cde82\"/>\n        <parameterMappings id=\"13\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-04-02 16:36:25',1,'2013-02-27 11:19:54',1,0,NULL,NULL,NULL,'d8851f73-9c11-4a75-8a9f-a254e725a97e'),(175,'Primary care receipt sequence data quality','Check the sequence of the primary care receipt numbers and show the missing numbers in the sequence.  Start column shows the first unused receipt number in the range and end column show the last unused receipt number in the range.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"d54ca9d2-fb35-40f5-a53c-1638484da6e3\" retired=\"false\">  <name>Primary care receipt sequence data quality</name>  <description>Check the sequence of the primary care receipt numbers and show the missing numbers in the sequence.  Start column shows the first unused receipt number in the range and end column show the last unused receipt number in the range.</description>    <dateCreated id=\"3\">2012-04-04 17:07:16 EDT</dateCreated>    <dateChanged id=\"4\">2012-04-10 18:12:20 EDT</dateChanged>  <parameters id=\"5\">    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">      <name>location</name>      <label>Location</label>      <type>org.openmrs.Location</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">      <name>startDate</name>      <label>Start Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">      <name>endDate</name>      <label>End Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>175</id>  <sqlQuery>select cast(o1.value_text+1 as unsigned) as startReceiptNum,&#xd;       min(cast(o2.value_text as unsigned))-1 as endReceiptNum&#xd;from obs o1, obs o2&#xd;where date(o1.obs_datetime) between :startDate and addDate(:endDate,1)&#xd;  and date(o2.obs_datetime) between :startDate and addDate(:endDate,1)&#xd;  and o1.concept_id = 6541&#xd;  and o2.concept_id = 6541&#xd;  and o1.encounter_id IN &#xd;   (select encounter_id&#xd;      from encounter&#xd;     where encounter_type = 13 &#xd;       and location_id = :location&#xd;       and date(encounter_datetime) between :startDate and addDate(:endDate,1) )&#xd; and cast(o1.value_text as unsigned) &lt; cast(o2.value_text as unsigned)&#xd;group by cast(o1.value_text as unsigned)&#xd;having startReceiptNum &lt; min(cast(o2.value_text as unsigned)) ;&#xd;</sqlQuery></org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-04 17:07:16',1010,'2012-04-14 10:44:34',1128,0,NULL,NULL,NULL,'d54ca9d2-fb35-40f5-a53c-1638484da6e3'),(176,'Test sql dataset','Playground','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"9e942329-00e4-4708-be68-b358f2841378\" retired=\"false\">\n  <name>Test sql dataset</name>\n  <description>Playground</description>\n  \n  <dateCreated id=\"3\">2012-04-04 17:15:33 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-30 15:21:45 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>diagnosis</name>\n      <label>diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>176</id>\n  <sqlQuery>select e.encounter_datetime,&#xd;\n       o.obs_id, &#xd;\n       :diagnosis as diagnosisConceptId &#xd;\n&#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between date(:startDate) &#xd;\n           and date_add(date(:startDate), interval 6 day)&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and pr.birthdate is NOT NULL &#xd;\n&#xd;\nwhere o.value_coded = :diagnosis&#xd;\n  and o.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-04 17:15:33',1010,'2012-11-02 12:02:14',1010,0,NULL,NULL,NULL,'9e942329-00e4-4708-be68-b358f2841378'),(177,'Primary care receipt sequence data quality','Show information about receipt numbers used at primary care registration.  \nThis includes a list of ranges for receipt numbers used, not included\nin the sequences, non-numerical values and minimum/maximum values).  ','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"a8b0b2cc-ff6c-4496-8f8d-af3bad90b996\" retired=\"false\">\n  <name>Primary care receipt sequence data quality</name>\n  <description>Show information about receipt numbers used at primary care registration.  \nThis includes a list of ranges for receipt numbers used, not included\nin the sequences, non-numerical values and minimum/maximum values).  </description>\n  \n  <dateCreated id=\"3\">2012-04-04 18:29:02 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-08-10 17:37:00 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>177</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>missingReceiptSequenceNumbers</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"d54ca9d2-fb35-40f5-a53c-1638484da6e3\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>nonNumericReceipts</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"13\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"14\" uuid=\"159ec5f7-25ce-4e6f-9f7a-84dcc30e2244\"/>\n        <parameterMappings reference=\"12\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>receiptSequenceNumbers</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"15\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"16\" uuid=\"6b4982c1-1dde-496b-8ffc-e87059ac1d9f\"/>\n        <parameterMappings reference=\"12\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>statsReceiptNumber</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"17\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"18\" uuid=\"5466d7ab-5f71-4dc6-aa4f-04612ffd8290\"/>\n        <parameterMappings id=\"19\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>receiptNumber</string>\n            <concept id=\"20\" uuid=\"20438dc7-c5b4-4d9c-8480-e888f4795123\"/>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType id=\"21\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-04-04 18:29:02',1010,'2012-08-10 17:37:00',1010,0,NULL,NULL,NULL,'a8b0b2cc-ff6c-4496-8f8d-af3bad90b996'),(178,'Non numeric receipt numbers','Find the receipt numbers which have alphabetic characters.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"159ec5f7-25ce-4e6f-9f7a-84dcc30e2244\" retired=\"false\">  <name>Non numeric receipt numbers</name>  <description>Find the receipt numbers which have alphabetic characters.</description>    <dateCreated id=\"3\">2012-04-09 16:20:22 EDT</dateCreated>    <dateChanged id=\"4\">2012-04-10 14:31:30 EDT</dateChanged>  <parameters id=\"5\">    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">      <name>startDate</name>      <label>startDate</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">      <name>endDate</name>      <label>endDate</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">      <name>location</name>      <label>Location</label>      <type>org.openmrs.Location</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>178</id>  <sqlQuery>select o.value_text as alphaReceipt,&#xd;       zl.identifier as patientID, &#xd;       o.voided as voided&#xd;from obs o, encounter e, patient_identifier zl  &#xd;where date(o.obs_datetime) between :startDate and addDate(:endDate,1)&#xd;  and e.location_id = :location &#xd;  and o.encounter_id = e.encounter_id&#xd;  and e.patient_id = zl.patient_id &#xd;  and e.encounter_type = 13 &#xd;  and o.concept_id = 6541&#xd;  and o.value_text NOT REGEXP &apos;^(-|\\\\+){0,1}([0-9]+\\\\.[0-9]*|[0-9]*\\\\.[0-9]+|[0-9]+)$&apos;&#xd;  and zl.identifier_type = 8 &#xd;  and o.voided = 0&#xd;  and e.voided = 0&#xd;  and zl.voided = 0&#xd;order by alphaReceipt DESC;</sqlQuery></org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-09 16:20:22',1010,'2012-04-14 10:44:34',1128,0,NULL,NULL,NULL,'159ec5f7-25ce-4e6f-9f7a-84dcc30e2244'),(179,'Used receipt number sequences','For a time range and location, show the starting and ending value for all valid numerical sequences (an uninterrupted, incrementing group of numbers)','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"6b4982c1-1dde-496b-8ffc-e87059ac1d9f\" retired=\"false\">  <name>Used receipt number sequences</name>  <description>For a time range and location, show the starting and ending value for all valid numerical sequences (an uninterrupted, incrementing group of numbers)</description>    <dateCreated id=\"3\">2012-04-11 10:20:55 EDT</dateCreated>    <dateChanged id=\"4\">2012-04-12 16:03:59 EDT</dateChanged>  <parameters id=\"5\">    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">      <name>startDate</name>      <label>Start Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">      <name>endDate</name>      <label>End Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">      <name>location</name>      <label>Location</label>      <type>org.openmrs.Location</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>179</id>  <sqlQuery>select&#xd; a.receipt_no AS startReceiptNumber,  &#xd; if(MIN(c.receipt_no) = a.receipt_no, NULL, min(c.receipt_no)) as endReceiptNumber&#xd;from  (&#xd;   select cast(value_text as unsigned) as receipt_no&#xd;     from obs&#xd;    where concept_id = 6541&#xd;      and encounter_id IN &#xd;          (select encounter_id&#xd;             from encounter&#xd;            where encounter_type = 13 &#xd;              and location_id = :location&#xd;              and date(encounter_datetime) &#xd;                  between :startDate and addDate(:endDate,1))&#xd;  order by receipt_no) a&#xd;LEFT JOIN (&#xd;   select cast(value_text as unsigned) as receipt_no&#xd;     from obs&#xd;    where concept_id = 6541&#xd;      and encounter_id IN &#xd;          (select encounter_id&#xd;             from encounter&#xd;            where encounter_type = 13 &#xd;              and location_id = :location&#xd;              and date(encounter_datetime) &#xd;                  between :startDate and addDate(:endDate,1) )&#xd;  order by receipt_no) b5 ON a.receipt_no = b5.receipt_no+1 &#xd;LEFT JOIN (&#xd;   select cast(value_text as unsigned) as receipt_no&#xd;     from obs&#xd;    where concept_id = 6541&#xd;      and encounter_id IN &#xd;          (select encounter_id&#xd;             from encounter&#xd;            where encounter_type = 13 &#xd;              and location_id = :location&#xd;              and date(encounter_datetime) &#xd;                  between :startDate and addDate(:endDate,1) )&#xd;  order by receipt_no) c ON a.receipt_no &lt;= c.receipt_no &#xd;LEFT JOIN (&#xd;   select cast(value_text as unsigned) as receipt_no&#xd;     from obs&#xd;    where concept_id = 6541&#xd;      and encounter_id IN &#xd;          (select encounter_id&#xd;             from encounter&#xd;            where encounter_type = 13 &#xd;              and location_id = :location&#xd;              and date(encounter_datetime) &#xd;                  between :startDate and addDate(:endDate,1) )&#xd;  order by receipt_no) d ON c.receipt_no = d.receipt_no-1 &#xd;WHERE b5.receipt_no IS NULL  &#xd;  AND c.receipt_no IS NOT NULL &#xd;  AND d.receipt_no IS NULL &#xd;GROUP BY a.receipt_no</sqlQuery></org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-11 10:20:55',1010,'2012-04-14 10:44:34',1128,0,NULL,NULL,NULL,'6b4982c1-1dde-496b-8ffc-e87059ac1d9f'),(180,'Non numeric dossier numbers','Find all the non-numeric dossier numbers.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"10de9dd0-a49e-46bc-897f-32fc56fba192\" retired=\"false\">\n  <name>Non numeric dossier numbers</name>\n  <description>Find all the non-numeric dossier numbers.</description>\n  \n  <dateCreated id=\"3\">2012-04-12 18:11:31 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 12:34:45 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>patientIdType1</name>\n      <label>ZL patient id type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>patientIdType2</name>\n      <label>Dossier patient id type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>180</id>\n  <sqlQuery>select zl.identifier as zlEmrId,&#xd;\n       dos.identifier as numeroDossier&#xd;\n  from patient p&#xd;\n&#xd;\nINNER JOIN &#xd;\n  (SELECT patient_id, identifier &#xd;\n     FROM patient_identifier &#xd;\n    WHERE voided = 0 &#xd;\n      AND identifier_type = :patientIdType1&#xd;\n    ORDER BY date_created DESC) zl&#xd;\n ON p.patient_id = zl.patient_id&#xd;\n&#xd;\nINNER JOIN &#xd;\n  (SELECT patient_id, identifier &#xd;\n     FROM patient_identifier &#xd;\n    WHERE voided = 0 &#xd;\n      AND identifier_type = :patientIdType2&#xd;\n      and identifier NOT REGEXP &apos;^(-|\\\\+){0,1}([0-9]+\\\\.[0-9]*|[0-9]*\\\\.[0-9]+|[0-9]+)$&apos; &#xd;\n    ORDER BY date_created DESC) dos&#xd;\n ON p.patient_id = dos.patient_id&#xd;\n&#xd;\nINNER JOIN encounter e &#xd;\n   ON p.patient_id = e.patient_id &#xd;\n  AND e.encounter_type = :encounterType&#xd;\n  and e.location_id = :location &#xd;\n  AND e.voided = 0 &#xd;\n  and date(e.encounter_datetime) between :startDate AND addDate(:endDate,1)&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\norder by numeroDossier asc; </sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-12 18:11:31',1010,'2012-05-01 12:34:45',1010,0,NULL,NULL,NULL,'10de9dd0-a49e-46bc-897f-32fc56fba192'),(182,'Dossier number statistics','The minimum and maximum dossier number for a date range and location.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"107fecf1-6b14-499b-9d9c-8e8f8e45bb67\" retired=\"false\">\n  <name>Dossier number statistics</name>\n  <description>The minimum and maximum dossier number for a date range and location.</description>\n  \n  <dateCreated id=\"3\">2012-04-12 18:57:58 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 12:04:47 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>patientIdType</name>\n      <label>Patient identifier type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>182</id>\n  <sqlQuery>select min(cast(pid.identifier as unsigned)) as minDossierNumber,&#xd;\n       max(cast(pid.identifier as unsigned)) as maxDossierNumber&#xd;\nfrom patient_identifier pid&#xd;\n&#xd;\ninner join patient p&#xd;\n   ON pid.patient_id = p.patient_id&#xd;\n  and p.voided = 0 &#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON p.patient_id = e.patient_id&#xd;\n  and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location &#xd;\n  and e.voided = 0&#xd;\n  and e.encounter_type = :encounterType&#xd;\n&#xd;\nwhere pid.identifier REGEXP &apos;^(-|\\\\+){0,1}([0-9]+\\\\.[0-9]*|[0-9]*\\\\.[0-9]+|[0-9]+)$&apos;&#xd;\n  and pid.identifier_type = :patientIdType&#xd;\n  and pid.voided = 0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-12 18:57:58',1010,'2012-05-01 12:04:47',1010,0,NULL,NULL,NULL,'107fecf1-6b14-499b-9d9c-8e8f8e45bb67'),(183,'Dossier number data quality','Information about dossier numbers -- min/max, ranges of used numbers, non-numeric numbers and dossier numbers used by multiple patients','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"091f50b6-a871-42cd-b8ea-592855a30ae5\" retired=\"false\">\n  <name>Dossier number data quality</name>\n  <description>Information about dossier numbers -- min/max, ranges of used numbers, non-numeric numbers and dossier numbers used by multiple patients</description>\n  \n  <dateCreated id=\"3\">2012-04-13 11:30:51 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 12:44:32 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>183</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>statsDossierNumber</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"107fecf1-6b14-499b-9d9c-8e8f8e45bb67\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>patientIdType</string>\n            <patientIdentifierType id=\"13\" uuid=\"e66645eb-03a8-4991-b4ce-e87318e37566\"/>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType id=\"14\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>nonNumericDossiers</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"15\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"16\" uuid=\"10de9dd0-a49e-46bc-897f-32fc56fba192\"/>\n        <parameterMappings id=\"17\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>patientIdType2</string>\n            <patientIdentifierType reference=\"13\"/>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>patientIdType1</string>\n            <patientIdentifierType id=\"18\" uuid=\"a541af1e-105c-40bf-b345-ba1fd6a59b85\"/>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType reference=\"14\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>dossierSequenceNumbers</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"19\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"20\" uuid=\"ad1bde88-d393-423b-8c2b-6f5f91e40d7c\"/>\n        <parameterMappings id=\"21\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>patientIdType</string>\n            <patientIdentifierType reference=\"13\"/>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType reference=\"14\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>dupeDossierNumbers</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"22\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"23\" uuid=\"f3822bb6-937f-40ef-a774-d2d301460792\"/>\n        <parameterMappings id=\"24\">\n          <entry>\n            <string>patientIdType</string>\n            <patientIdentifierType reference=\"13\"/>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType reference=\"14\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-04-13 11:30:51',1010,'2012-05-01 12:44:32',1010,0,NULL,NULL,NULL,'091f50b6-a871-42cd-b8ea-592855a30ae5'),(184,'Used dossier number sequences','These are the ranges of dossier numbers that are used for a location and start/end date range.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"ad1bde88-d393-423b-8c2b-6f5f91e40d7c\" retired=\"false\">\n  <name>Used dossier number sequences</name>\n  <description>These are the ranges of dossier numbers that are used for a location and start/end date range.</description>\n  \n  <dateCreated id=\"3\">2012-04-13 11:46:11 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 12:38:05 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>patientIdType</name>\n      <label>Patient identifier type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>184</id>\n  <sqlQuery>select&#xd;\n a.dossier_no as startDossierNumber,  &#xd;\n if(min(c.dossier_no) = a.dossier_no, NULL, min(c.dossier_no)) as endDossierNumber&#xd;\nfrom  (&#xd;\n   select cast(identifier as unsigned) as dossier_no&#xd;\n     from patient_identifier&#xd;\n    where identifier_type = :patientIdType&#xd;\n      and patient_id IN &#xd;\n          (select distinct(patient_id)&#xd;\n             from encounter&#xd;\n            where encounter_type = :encounterType&#xd;\n              and location_id = :location&#xd;\n              and date(encounter_datetime) &#xd;\n                  between :startDate and addDate(:endDate,1))&#xd;\n  order by dossier_no) a&#xd;\nLEFT JOIN (&#xd;\n   select cast(identifier as unsigned) as dossier_no&#xd;\n     from patient_identifier&#xd;\n    where identifier_type = :patientIdType&#xd;\n      and patient_id IN &#xd;\n          (select distinct(patient_id)&#xd;\n             from encounter&#xd;\n            where encounter_type = :encounterType&#xd;\n              and location_id = :location&#xd;\n              and date(encounter_datetime) &#xd;\n                  between :startDate and addDate(:endDate,1))&#xd;\n  order by dossier_no) b ON a.dossier_no = b.dossier_no+1 &#xd;\nLEFT JOIN (&#xd;\n   select cast(identifier as unsigned) as dossier_no&#xd;\n     from patient_identifier&#xd;\n    where identifier_type = :patientIdType&#xd;\n      and patient_id IN &#xd;\n          (select distinct(patient_id)&#xd;\n             from encounter&#xd;\n            where encounter_type = :encounterType&#xd;\n              and location_id = :location&#xd;\n              and date(encounter_datetime) &#xd;\n                  between :startDate and addDate(:endDate,1))&#xd;\n  order by dossier_no) c ON a.dossier_no &lt;= c.dossier_no &#xd;\nLEFT JOIN (&#xd;\n   select cast(identifier as unsigned) as dossier_no&#xd;\n     from patient_identifier&#xd;\n    where identifier_type = :patientIdType&#xd;\n      and patient_id IN &#xd;\n          (select distinct(patient_id)&#xd;\n             from encounter&#xd;\n            where encounter_type = :encounterType &#xd;\n              and location_id = :location&#xd;\n              and date(encounter_datetime) &#xd;\n                  between :startDate and addDate(:endDate,1))&#xd;\n  order by dossier_no) d ON c.dossier_no = d.dossier_no-1 &#xd;\nWHERE b.dossier_no IS NULL  &#xd;\n  AND c.dossier_no IS NOT NULL &#xd;\n  AND d.dossier_no IS NULL &#xd;\nGROUP BY a.dossier_no</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-13 11:46:11',1010,'2012-05-01 12:38:05',1010,0,NULL,NULL,NULL,'ad1bde88-d393-423b-8c2b-6f5f91e40d7c'),(185,'Duplicate dossier numbers','Find all the dossier numbers that are assigned to 2 patients','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"f3822bb6-937f-40ef-a774-d2d301460792\" retired=\"false\">\n  <name>Duplicate dossier numbers</name>\n  <description>Find all the dossier numbers that are assigned to 2 patients</description>\n  \n  <dateCreated id=\"3\">2012-04-13 12:40:52 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 12:43:36 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>patientIdType</name>\n      <label>Patient identifier type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>185</id>\n  <sqlQuery>select cast(pi.identifier as unsigned) as intDossierNumber, &#xd;\n       cast(pi.identifier as char(12)) as dossierNumber, &#xd;\n       count(*) as count&#xd;\nfrom patient p, patient_identifier pi, encounter e  &#xd;\nwhere e.location_id = :location &#xd;\n  and e.patient_id = p.patient_id &#xd;\n  and p.patient_id = pi.patient_id &#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and pi.identifier_type = :patientIdType&#xd;\n  and pi.identifier REGEXP &apos;^(-|\\\\+){0,1}([0-9]+\\\\.[0-9]*|[0-9]*\\\\.[0-9]+|[0-9]+)$&apos;&#xd;\n  and p.voided = 0&#xd;\n  and pi.voided = 0&#xd;\n  and e.voided = 0&#xd;\ngroup by dossierNumber&#xd;\nhaving count(*) &gt; 1&#xd;\norder by intDossierNumber;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-13 12:40:52',1010,'2012-05-01 12:43:36',1010,0,NULL,NULL,NULL,'f3822bb6-937f-40ef-a774-d2d301460792'),(186,'Test format','Test for integer or chars.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"9237ffae-720d-49ab-b78d-a7eabd539380\" retired=\"false\">\n  <name>Test format</name>\n  <description>Test for integer or chars.</description>\n  \n  <dateCreated id=\"3\">2012-04-16 14:54:38 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-16 14:55:44 EDT</dateChanged>\n  <parameters id=\"5\"/>\n  <id>186</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>test</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" uuid=\"9e942329-00e4-4708-be68-b358f2841378\"/>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>startDate</string>\n            <date id=\"10\">2012-01-01 00:00:00 EST</date>\n          </entry>\n          <entry>\n            <string>diagnosis</string>\n            <concept id=\"11\" uuid=\"31ab7170-0370-102d-b0e3-001ec94a0cc1\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-04-16 14:54:38',1010,'2012-11-21 22:16:51',960,0,NULL,NULL,NULL,'9237ffae-720d-49ab-b78d-a7eabd539380'),(187,'Primary care reception visit volume by hour','Daily report showing the number of patients seen at reception, by hour (ideally compared to the same day last week and the average for that day of the week). Used by M&E supervisor to check on status of the Primary Care system remotely.  ','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"c3946814-f264-4974-8d1f-a70361dadd5c\" retired=\"false\">\n  <name>Primary care reception visit volume by hour</name>\n  <description>Daily report showing the number of patients seen at reception, by hour (ideally compared to the same day last week and the average for that day of the week). Used by M&amp;E supervisor to check on status of the Primary Care system remotely.  </description>\n  \n  <dateCreated id=\"3\">2012-04-18 13:33:49 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-19 17:02:24 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>187</id>\n  <sqlQuery>select hour(e.encounter_datetime) as byHour, count(*) as freq&#xd;\nfrom patient p&#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   on p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = 13&#xd;\n  and date(e.encounter_datetime) = :date&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on e.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\ngroup by hour(e.encounter_datetime);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-18 13:33:49',1010,'2012-04-19 17:02:24',1010,0,NULL,NULL,NULL,'c3946814-f264-4974-8d1f-a70361dadd5c'),(188,'Primary care reception visit volume','Daily report showing the number of patients seen at reception, by hour (ideally compared to the same day last week and the average for that day of the week). Used by M&E supervisor to check on status of the Primary Care system remotely.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"6761a82c-ac5a-4251-a756-9b37d124a895\" retired=\"false\">\n  <name>Primary care reception visit volume</name>\n  <description>Daily report showing the number of patients seen at reception, by hour (ideally compared to the same day last week and the average for that day of the week). Used by M&amp;E supervisor to check on status of the Primary Care system remotely.</description>\n  \n  <dateCreated id=\"3\">2012-04-18 16:22:32 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-23 17:58:17 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.