.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">      <name>type</name>      <label>Type</label>      <type>org.openmrs.EncounterType</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>187</id>  <type>COUNT</type>  <cohortDefinition id=\"10\">    <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.EncounterCohortDefinition\" id=\"11\" uuid=\"8897d9c7-a8e5-4f7a-89cf-bcffafaacb3a\"/>    <parameterMappings id=\"12\">      <entry>        <string>onOrBefore</string>        <string>${endDate}</string>      </entry>      <entry>        <string>locationList</string>        <string>${location}</string>      </entry>      <entry>        <string>encounterTypeList</string>        <string>${type}</string>      </entry>      <entry>        <string>onOrAfter</string>        <string>${startDate}</string>      </entry>    </parameterMappings>  </cohortDefinition></org.openmrs.module.reporting.indicator.CohortIndicator>','2012-04-19 11:35:10',1055,'2012-04-19 11:41:59',1128,0,NULL,NULL,NULL,'c5e77d18-afda-4b9f-b90f-406538da7c59'),(191,'Primary care reception visit volume by day','Daily report showing the number of patients seen at reception per day. Used by M&E supervisor to check on status of the Primary Care system remotely.  ','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"5841d68e-e10c-4dfb-9e42-92a25730f6e3\" retired=\"false\">\n  <name>Primary care reception visit volume by day</name>\n  <description>Daily report showing the number of patients seen at reception per day. Used by M&amp;E supervisor to check on status of the Primary Care system remotely.  </description>\n  \n  <dateCreated id=\"3\">2012-04-19 11:38:45 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-19 11:59:04 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>191</id>\n  <sqlQuery>select date_format(e.encounter_datetime, &apos;%c-%e&apos; ) as byDay, count(*)&#xd;\nfrom patient p&#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   on p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = 13&#xd;\n  and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on e.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\ngroup by date(e.encounter_datetime);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-19 11:38:45',1010,'2012-04-19 11:59:04',1010,0,NULL,NULL,NULL,'5841d68e-e10c-4dfb-9e42-92a25730f6e3'),(192,'Hostname','Show the hostname of the server.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"254fbbbf-6e9f-49aa-a3ec-8c5b042cde82\" retired=\"false\">\n  <name>Hostname</name>\n  <description>Show the hostname of the server.</description>\n  \n  <dateCreated id=\"3\">2012-04-19 15:36:47 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-19 15:44:51 EDT</dateChanged>\n  <parameters id=\"5\"/>\n  <id>192</id>\n  <sqlQuery>select variable_value as servername &#xd;\n  from information_schema.global_variables&#xd;\n where variable_name like &apos;hostname&apos;;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-19 15:36:47',1010,'2012-04-19 15:44:51',1010,0,NULL,NULL,NULL,'254fbbbf-6e9f-49aa-a3ec-8c5b042cde82'),(193,'Primary care reception visit volume previous week','Visit volume from the 7 days earlier.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"86f011d3-a6dd-466f-bec3-31376b88c2de\" retired=\"false\">\n  <name>Primary care reception visit volume previous week</name>\n  <description>Visit volume from the 7 days earlier.</description>\n  \n  <dateCreated id=\"3\">2012-04-19 18:17:30 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-23 17:01:42 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>193</id>\n  <sqlQuery>select hour(e.encounter_datetime) as byHourLastWeek, &#xd;\n       count(*) as freqLastWeek&#xd;\nfrom patient p&#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   on p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = 13&#xd;\n  and date(e.encounter_datetime) = subDate(:date,7)&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on e.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\ngroup by hour(e.encounter_datetime);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-19 18:17:30',1010,'2012-04-23 17:01:42',1010,0,NULL,NULL,NULL,'86f011d3-a6dd-466f-bec3-31376b88c2de'),(194,'Missing encounters per day','Compare patient encounters per day.  Show patients (ZLEMR id, name and gender) for all patients that are missing one of the 3 encounters (reception, registration or visit).','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"3303f85d-9d3c-4555-98b5-548048b3af1e\" retired=\"false\">\n  <name>Missing encounters per day</name>\n  <description>Compare patient encounters per day.  Show patients (ZLEMR id, name and gender) for all patients that are missing one of the 3 encounters (reception, registration or visit).</description>\n  \n  <dateCreated id=\"3\">2012-04-20 12:03:30 EDT</dateCreated>\n  \n  <dateChanged id=\"5\">2012-07-03 13:48:17 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>registrationEncounterType</name>\n      <label>Registration encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>receptionEncounterType</name>\n      <label>Reception encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>primaryCareVisitEncounterType</name>\n      <label>Primary care visit encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>dossierIdType</name>\n      <label>Dossier number type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>zlIdType</name>\n      <label>zlIdType</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>194</id>\n  <sqlQuery>SELECT dossier.identifier as &apos;Dossier&apos;,&#xd;\n       zl.identifier as &apos;ZL EMR ID&apos;,&#xd;\n       concat(n.given_name, &apos; &apos;, n.family_name) as &apos;Patient nom&apos;,&#xd;\n       concat(&apos;https://&apos;, (select variable_value as servername &#xd;\n                from information_schema.global_variables&#xd;\n               where variable_name like &apos;hostname&apos;), &#xd;\n               &apos;/openmrs/module/patientregistration/workflow/patientDashboard.form?patientId=&apos;, cast(pr.person_id as char(8))) as URL,  &#xd;\n       pr.gender as Sexe, &#xd;\n       date(e.encounter_datetime) as EncounterDate, &#xd;\n       count(case &#xd;\n             when e.encounter_type = :registrationEncounterType &#xd;\n             then e.patient_id &#xd;\n             else null &#xd;\n             end) as &apos;Registration&apos;, &#xd;\n       count(case &#xd;\n             when e.encounter_type = :receptionEncounterType &#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) as &apos;Reception&apos;, &#xd;\n       count(case &#xd;\n             when e.encounter_type = :primaryCareVisitEncounterType&#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) as &apos;PrimaryCareVisit&apos;, &#xd;\n       count(*) as TotalVisits&#xd;\n&#xd;\n  from encounter e&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON e.patient_id = pr.person_id&#xd;\n  and pr.voided = 0&#xd;\n&#xd;\nINNER JOIN person_name n &#xd;\n   ON e.patient_id = n.person_id&#xd;\n  and n.voided = 0&#xd;\n&#xd;\nINNER JOIN patient p &#xd;\n   ON e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier zl &#xd;\n   ON e.patient_id = zl.patient_id&#xd;\n  AND zl.identifier_type = :zlIdType&#xd;\n  AND zl.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier dossier &#xd;\n   ON e.patient_id = dossier.patient_id&#xd;\n  AND dossier.identifier_type = :dossierIdType&#xd;\n  AND dossier.voided = 0&#xd;\n&#xd;\nwhere e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n  and date(e.encounter_datetime) = :date&#xd;\n&#xd;\n&#xd;\ngroup by date(e.encounter_datetime), e.patient_id&#xd;\n &#xd;\nhaving Registration &lt;&gt; 1 &#xd;\n    or Reception &lt;&gt; 1&#xd;\n    or PrimaryCareVisit &lt;&gt; 1;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-20 12:03:30',1100,'2012-07-03 13:48:17',1010,0,NULL,NULL,NULL,'3303f85d-9d3c-4555-98b5-548048b3af1e'),(195,'Seven days earlier','Calculate the 7 days previous to the requested date.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"57ac7f65-1ca5-4e09-8dc1-1cb6cf68b7b3\" retired=\"false\">\n  <name>Seven days earlier</name>\n  <description>Calculate the 7 days previous to the requested date.</description>\n  \n  <dateCreated id=\"3\">2012-04-23 17:45:00 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-23 17:56:18 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>195</id>\n  <sqlQuery>select subdate(date(:date),7) as sevenDaysEarlier&#xd;\nfrom location&#xd;\nlimit 1;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-23 17:45:00',1010,'2012-04-23 17:56:18',1010,0,NULL,NULL,NULL,'57ac7f65-1ca5-4e09-8dc1-1cb6cf68b7b3'),(196,'Patients with 50 gde payment','The cohort of patients where payment of 50 gde was required.','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"d944576f-b898-482c-ba85-f58be5e8a684\" retired=\"false\">\n  <name>Patients with 50 gde payment</name>\n  <description>The cohort of patients where payment of 50 gde was required.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 11:17:05 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">20