location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>receiptNumber</string>\n            <concept reference=\"17\"/>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType reference=\"18\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-01-15 21:32:11',1010,'2013-01-15 21:32:11',1010,0,NULL,NULL,NULL,'593a1917-5759-48d7-b158-f33d2975b4d5'),(263,'_Missing consultations for time period V2','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"181e8ebe-63fc-4374-9770-64ba8c917b51\" retired=\"false\">\n  <name>_Missing consultations for time period V2</name>\n  <description></description>\n  <changedBy id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"3\">2013-03-22 11:35:03 CET</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>receptionEncounterType</name>\n      <label>receptionEncounterType</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>dossierIdType</name>\n      <label>dossierIdType</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>primaryCareVisitEncounterType</name>\n      <label>primaryCareVisitEncounterType</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>263</id>\n  <sqlQuery>SELECT dossier.identifier as &apos;Dossier&apos;,&#xd;\n       concat(n.given_name, &apos; &apos;, n.family_name) as &apos;Non pasyan&apos;,&#xd;\n       pr.gender as Sex, &#xd;\n       date(e.encounter_datetime) as &apos;Dat rendezvous&apos;,&#xd;\n       &apos; &apos; as &apos;Rezon li pat nan sistem nan&apos;&#xd;\n from encounter e&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON e.patient_id = pr.person_id&#xd;\n  and pr.voided = 0&#xd;\n&#xd;\nINNER JOIN person_name n &#xd;\n   ON e.patient_id = n.person_id&#xd;\n  and n.voided = 0&#xd;\n&#xd;\nINNER JOIN patient p &#xd;\n   ON e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier dossier &#xd;\n   ON e.patient_id = dossier.patient_id&#xd;\n  AND dossier.identifier_type = :dossierIdType&#xd;\n  AND dossier.voided = 0&#xd;\n&#xd;\n where e.location_id = :location&#xd;\n   and e.voided = 0&#xd;\n   and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n   and e.encounter_type IN (:receptionEncounterType, :primaryCareVisitEncounterType)&#xd;\n&#xd;\ngroup by date(e.encounter_datetime), e.patient_id &#xd;\n&#xd;\nhaving count(case &#xd;\n             when e.encounter_type = :receptionEncounterType&#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) &gt; 0&#xd;\n   and count(case &#xd;\n             when e.encounter_type = :primaryCareVisitEncounterType&#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) = 0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-03-22 11:35:03',1,'2013-03-22 11:35:03',1,0,NULL,NULL,NULL,'181e8ebe-63fc-4374-9770-64ba8c917b51'),(264,'Reception Encounters with provider information V2','Patients who had a reception encounter (among with other things). Version 2.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"e16684c9-6a73-49b7-a286-d60333cec02b\" retired=\"false\">\n  <name>Reception Encounters with provider information V2</name>\n  <description>Patients who had a reception encounter (among with other things). Version 2.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>outpatientVisit</name>\n      <label>outpatientVisit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>erVisit</name>\n      <label>erVisit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>medicalCert</name>\n      <label>medicalCert</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>marriageCert</name>\n      <label>marriageCert</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>dentalVisit</name>\n      <label>dentalVisit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>pcVisit</name>\n      <label>pcVisit</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>patientPayment</name>\n      <label>patientPayment</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>reasonForVisit</name>\n      <label>reasonForVisit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>zlDiagnosisCoded</name>\n      <label>zlDiagnosisCoded</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>zlDiagnosisNonCoded</name>\n      <label>zlDiagnosisNonCoded</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>providerId</name>\n      <label>providerId</label>\n      <type>org.openmrs.PersonAttributeType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"14\">\n      <name>zlEmrId</name>\n      <label>zlEmrId</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"15\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"16\">\n      <name>pcReception</name>\n      <label>pcReception</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"17\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"18\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>264</id>\n  <sqlQuery>SELECT  e.patient_id as &apos;PatientId&apos;, &#xd;\n	zl.identifier as &apos;ZL EMR ID&apos;, &#xd;\n	n.given_name as FirstName, &#xd;\n	n.family_name as LastName, &#xd;\n	p.gender as Gender, &#xd;\n	e.encounter_datetime as &apos;ReceptionDateTime&apos;,&#xd;\n        o1.value_numeric as &apos;PaymentAmount&apos;,&#xd;\n        case when reason.value_coded = :outpatientVisit then &apos;Outpatient&apos; &#xd;\n	     when reason.value_coded = :erVisit then &apos;ER&apos;&#xd;\n	     when reason.value_coded = :medicalCert then &apos;Medical certificate&apos;&#xd;\n	     when reason.value_coded = :marriageCert then &apos;Marriage certificate&apos;&#xd;\n	     when reason.value_coded = :dentalVisit then &apos;Dental&apos;&#xd;\n	     else &apos;Other&apos;  &#xd;\n	end as &apos;VisitReason&apos;,&#xd;\n	date(e2.encounter_datetime) as &apos;PrimaryCareVisitDateTime&apos;,&#xd;\n        case when (o2.value_coded is not null) then &#xd;\n                (select cn.name &#xd;\n		from concept c, concept_name cn&#xd;\n		where c.concept_id = cn.concept_id &#xd;\n		and c.concept_id = o2.value_coded&#xd;\n                and cn.voided = 0 &#xd;\n		and cn.locale_preferred = 0 &#xd;\n		and cn.locale = &apos;en&apos; &#xd;\n		and cn.concept_name_type = &apos;FULLY_SPECIFIED&apos;)&#xd;\n        else &apos;&apos; &#xd;\n       	end as &apos;CodedDiagnosis&apos;,&#xd;\n        o2.value_coded as &apos;CodedDiagnosis_ConceptId&apos;, &#xd;\n	ifnull(o2.value_text, &apos;&apos;) as NonCodedDiagnosis, &#xd;\n	ep.provider_id as &apos;ProviderId&apos;, &#xd;\n	pv.person_id as &apos;ProviderPersonId&apos;, &#xd;\n	ifnull(concat(pn.given_name, &apos; &apos;, pn.family_name, &apos; (&apos;, pa.value, &apos;)&apos;), &apos;&apos;) as &apos;DoctorName&apos;&#xd;\nFROM encounter e &#xd;\n&#xd;\njoin patient_identifier zl&#xd;\n  on e.patient_id = zl.patient_id&#xd;\n&#xd;\njoin location l &#xd;\n  on e.location_id = l.location_id &#xd;\n&#xd;\njoin person p&#xd;\n  on e.patient_id = p.person_id &#xd;\n&#xd;\njoin person_name n&#xd;\n  on p.person_id=n.person_id  &#xd;\n&#xd;\nleft outer join encounter e2 &#xd;\n  on p.person_id = e2.patient_id&#xd;\n and e2.encounter_type = :pcVisit&#xd;\n and date(e2.encounter_datetime) = date(e.encounter_datetime)&#xd;\n&#xd;\nleft outer join obs o1 &#xd;\n  on e.encounter_id = o1.encounter_id&#xd;\n and o1.concept_id = :patientPayment&#xd;\n and o1.voided = 0&#xd;\n&#xd;\nleft outer join obs reason &#xd;\n  on o1.obs_group_id = reason.obs_group_id&#xd;\n and reason.concept_id = :reasonForVisit&#xd;\n and reason.voided = 0&#xd;\n&#xd;\nleft outer join obs o2&#xd;\n  on e2.encounter_id = o2.encounter_id&#xd;\n and (o2.concept_id = :zlDiagnosisCoded &#xd;\n   or o2.concept_id = :zlDiagnosisNonCoded)&#xd;\n and o2.voided = 0 &#xd;\n&#xd;\nleft outer join encounter_provider ep&#xd;\n  on ep.encounter_id = e2.encounter_id&#xd;\n and ep.voided = 0&#xd;\n&#xd;\nleft outer join provider pv&#xd;\n  on ep.provider_id = pv.provider_id&#xd;\n&#xd;\nleft outer join person_name pn&#xd;\n  on pv.person_id = pn.person_id&#xd;\n and pn.voided = 0   &#xd;\n&#xd;\nleft outer join person_attribute pa &#xd;\n  on pv.person_id = pa.person_id&#xd;\n and pa.person_attribute_type_id = :providerId&#xd;\n&#xd;\nwhere zl.identifier_type = :zlEmrId &#xd;\n  and l.location_id = :location &#xd;\n  and e.encounter_type = :pcReception&#xd;\n  and date(e.encounter_datetime) &gt;=  :startDate&#xd;\n  and date(e.encounter_datetime) &lt;=  :endDate  &#xd;\n  and p.voided = 0&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ngroup by e.encounter_datetime</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-02-02 21:29:27',1010,'2013-02-02 21:29:27',1010,0,NULL,NULL,NULL,'e16684c9-6a73-49b7-a286-d60333cec02b'),(265,'_Mobile Clinic LQAS','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"08fa6d17-6124-48a4-b2ea-06ed1e3b464f\" retired=\"false\">\n  <name>_Mobile Clinic LQAS</name>\n  <description></description>\n  <changedBy id=\"2\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"3\">2013-04-03 10:28:15 CEST</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>265</id>\n  <sqlQuery>SELECT &#xd;\n  &apos;&apos; as &apos;Dossier Found? Y/N&apos;, &#xd;\n  d.identifier as &apos;Mobile Clinic ID&apos;, &#xd;\n  concat(patientn.given_name, &apos; &apos;, patientn.family_name) as &apos;Patient Name&apos;,&#xd;\n  date(pc.encounter_datetime) as &apos;Visit Date&apos;, &#xd;\n  cd1n.name as &apos;Coded 1&apos;, cd2n.name as &apos;Coded 2&apos;, cd3n.name as &apos;Coded 3&apos;, nc1.value_text as &apos;Non-Coded 1&apos;, nc2.value_text as &apos;Non-Coded 2&apos;, nc3.value_text as &apos;Non-Coded 3&apos;, &#xd;\n  hivn.name as &apos;HIV Test&apos;, hivrn.name as &apos;HIV Test Result&apos;,&#xd;\n  -- quick way to see if one encounter has 5 obs for TB screening&#xd;\n  CASE&#xd;\n    WHEN (select count(*) from obs o, concept c where o.encounter_id=pc.encounter_id and o.concept_id = c.concept_id and c.uuid in (&apos;0bde4475-8d22-4f60-9c5d-7df16f41f7fd&apos;, &apos;8710cce2-0070-408f-9961-40312d0b976d&apos;, &apos;b838aeb3-9df4-4bca-aa43-3cd5de29801a&apos;,&apos;3f5d6a62-4dbc-4ef9-8264-29ef15f53b31&apos;, &apos;84d4ac55-e1ac-4bc0-ae42-7bd7c028cd4a&apos;)) = 5 THEN &apos;YES&apos;&#xd;\n    ELSE &apos;NO&apos;&#xd;\n  END as &apos;TB screening complete&apos;,&#xd;\n  referral_n.name as &apos;Patient referred&apos;,&#xd;\n  referral_loc.name as &apos;Referral destination&apos;,&#xd;\n  concat(un.given_name, &apos; &apos;, un.family_name) as &apos;Data Clerk who entered diagnosis&apos;, &#xd;\n  concat(cln.given_name, &apos; &apos;, cln.family_name) as &apos;Clinician who saw patient&apos;&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN encounter pc ON p.patient_id = pc.patient_id AND pc.encounter_type = (SELECT encounter_type_id FROM encounter_type where uuid = &apos;fec6f3ed-6a3c-4c47-8982-a28f96befb5b&apos;) AND pc.voided = 0 AND pc.encounter_datetime BETWEEN :startDate AND :endDate &#xd;\n&#xd;\nINNER JOIN patient_identifier d ON p.patient_id = d.patient_id AND d.identifier_type = (SELECT patient_identifier_type_id FROM patient_identifier_type WHERE uuid = &apos;08f7f751-4168-473f-903b-3bde8e8a70f6&apos;) AND d.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd1 ON pc.encounter_id = cd1.encounter_id AND cd1.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd1.voided = 0&#xd;\nLEFT OUTER JOIN concept_name cd1n ON cd1.value_coded = cd1n.concept_id AND cd1n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd2 ON pc.encounter_id = cd2.encounter_id AND cd2.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd2.voided = 0 AND cd2.obs_id != cd1.obs_id&#xd;\nLEFT OUTER JOIN concept_name cd2n ON cd2.value_coded = cd2n.concept_id AND cd2n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd3 ON pc.encounter_id = cd3.encounter_id AND cd3.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd3.voided = 0 AND cd3.obs_id NOT IN (cd1.obs_id, cd2.obs_id)&#xd;\nLEFT OUTER JOIN concept_name cd3n ON cd3.value_coded = cd3n.concept_id AND cd3n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc1 ON pc.encounter_id = nc1.encounter_id AND nc1.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc1.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc2 ON pc.encounter_id = nc2.encounter_id AND nc2.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc2.voided = 0 AND nc2.obs_id != nc1.obs_id&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc3 ON pc.encounter_id = nc3.encounter_id AND nc3.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc3.voided = 0 AND nc3.obs_id NOT IN (nc1.obs_id, nc2.obs_id)&#xd;\n&#xd;\nLEFT OUTER JOIN obs hiv ON pc.encounter_id = hiv.encounter_id AND hiv.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;ebe8c03d-4d42-4129-820b-a9ebfe30e910&apos;) AND hiv.voided = 0&#xd;\nLEFT OUTER JOIN concept_name hivn ON hiv.value_coded = hivn.concept_id AND hivn.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs hivr ON pc.encounter_id = hivr.encounter_id AND hivr.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;31c49556-0370-102d-b0e3-001ec94a0cc1&apos;) AND hivr.voided = 0&#xd;\nLEFT OUTER JOIN concept_name hivrn ON hivr.value_coded = hivrn.concept_id AND hivrn.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs referral ON pc.encounter_id = referral.encounter_id AND referral.concept_id = (SELECT concept_id FROM concept WHERE uuid=&apos;3faeb7cd-618b-4a6e-a735-da0069c051f4&apos;) AND referral.voided = 0&#xd;\nLEFT OUTER JOIN concept_name referral_n ON referral.value_coded = referral_n.concept_id AND referral_n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs referral_dest ON pc.encounter_id = referral_dest.encounter_id AND referral_dest.concept_id = (SELECT concept_id FROM concept WHERE uuid=&apos;5379877c-699e-4f50-a10c-60cecebb19ff&apos;) AND referral_dest.voided = 0&#xd;\nLEFT OUTER JOIN location referral_loc ON referral_dest.value_text = referral_loc.location_id&#xd;\n&#xd;\nINNER JOIN encounter_provider enpr ON pc.encounter_id = enpr.encounter_id AND enpr.voided = 0&#xd;\n&#xd;\nINNER JOIN users u ON enpr.creator = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name un ON u.person_id = un.person_id&#xd;\n&#xd;\nINNER JOIN provider pr ON enpr.provider_id = pr.provider_id&#xd;\n&#xd;\nINNER JOIN person_name cln ON pr.person_id = cln.person_id&#xd;\n&#xd;\nINNER JOIN person_name patientn ON patientn.person_id = p.patient_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY pc.encounter_id&#xd;\n&#xd;\nORDER BY RAND()&#xd;\nLIMIT 25;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-04-03 10:28:15',3,'2013-04-03 10:28:15',3,0,NULL,NULL,NULL,'08fa6d17-6124-48a4-b2ea-06ed1e3b464f'),(266,'_Mobile Clinic LQAS','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d79c5fec-ca07-42a6-8d43-77eeec10ea3e\" retired=\"false\">\n  <name>_Mobile Clinic LQAS</name>\n  <description></description>\n  <changedBy id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"3\">2013-03-22 10:41:41 CET</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>266</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" uuid=\"08fa6d17-6124-48a4-b2ea-06ed1e3b464f\"/>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-03-22 10:41:41',1,'2013-03-22 10:41:41',1,0,NULL,NULL,NULL,'d79c5fec-ca07-42a6-8d43-77eeec10ea3e'),(267,'_Patient visit summary','for Mobile Clinics','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"e372d890-d4ef-4f88-b641-e90ce3f9efaf\" retired=\"false\">\n  <name>_Patient visit summary</name>\n  <description>for Mobile Clinics</description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-21 22:12:19 CET</dateCreated>\n  <changedBy id=\"4\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"5\">2013-03-23 15:10:54 CET</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>267</id>\n  <sqlQuery>SELECT &#xd;\n  loc.name as Site,&#xd;\n  DATE(dx.encounter_datetime) AS &apos;Date of Mobile Clinic&apos;,&#xd;\n  mobile_loc.value_text as &apos;Location of Mobile Clinic&apos;,&#xd;\n  gps.value_text as &apos;GPS Coordinates&apos;,&#xd;\n  CASE &#xd;\n    WHEN (SELECT COUNT(*) FROM encounter WHERE patient_id=p.patient_id AND voided = 0 AND DATE(encounter_datetime) &lt; DATE(dx.encounter_datetime)) = 0 THEN &apos;new&apos;&#xd;\n    ELSE &apos;return&apos;&#xd;\n  END AS &apos;Visit Type&apos;,&#xd;\n  p.patient_id as &apos;Patient Id (internal)&apos;,&#xd;\n  zlemr.identifier AS &apos;Mobile Clinic Id&apos;,&#xd;\n  pn.given_name AS FirstName,&#xd;\n  pn.family_name AS LastName,&#xd;\n  pr.gender AS Gender,&#xd;\n  ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &apos;Age At Visit&apos;, &#xd;\n  IF(ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &gt; 14, &apos;1&apos;, &apos;0&apos;) &apos;15 and older&apos;, &#xd;\n  IF(ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &lt; 15, &apos;1&apos;, &apos;0&apos;) &apos;Under 15&apos;, &#xd;\n  a.state_province Departement, a.city_village Commune, a.address3 &apos;Section communale&apos;, a.address1 Locality,&#xd;\n  &apos;source N/A&apos;,&#xd;\n  &apos;TODO: sectionID&apos;,&#xd;\n  pregnant_n.name AS Pregnant,&#xd;\n  muac_n.name AS MUAC,&#xd;\n  cough_n.name AS &apos;TB Cough&apos;,&#xd;\n  fever_n.name AS &apos;TB Fever&apos;,&#xd;\n  sweat_n.name AS &apos;TB Sweat&apos;,&#xd;\n  weight_n.name AS &apos;TB Weight&apos;,&#xd;\n  tb_n.name AS &apos;TB Contact&apos;,&#xd;\n  hiv_n.name AS &apos;HIV Test Conducted&apos;,&#xd;\n  hiv_r_n.name AS &apos;HIV Test Result&apos;,&#xd;\n  cd1n.name AS &apos;Coded Diagnosis 1&apos;,&#xd;\n  cd2n.name AS &apos;Coded Diagnosis 2&apos;,&#xd;\n  cd3n.name AS &apos;Coded Diagnosis 3&apos;,&#xd;\n  nc1.value_text AS &apos;NonCoded Diagnosis 1&apos;,&#xd;\n  nc2.value_text AS &apos;NonCoded Diagnosis 2&apos;,&#xd;\n  nc3.value_text AS &apos;NonCoded Diagnosis 3&apos;,&#xd;\n  CONCAT(prov_name.given_name, &apos; &apos;, prov_name.family_name) AS &apos;Provider Name&apos;,&#xd;\n  referral_n.name AS &apos;Patient referred&apos;,&#xd;\n  referral_loc_loc.name AS &apos;Referral Institution&apos;,&#xd;\n  trans_n.name AS &apos;Emergency Transport provided&apos;,&#xd;\n  (SELECT GROUP_CONCAT(cn.name SEPARATOR &apos;, &apos;) &#xd;\n    FROM obs o, concept_name cn &#xd;\n    WHERE o.encounter_id = dx.encounter_id AND o.concept_id = 6760&#xd;\n      AND o.voided = 0 AND cn.voided = 0 AND cn.concept_id = o.value_coded AND cn.locale=&apos;fr&apos;) &#xd;\n   AS &apos;Reason(s) for Referral&apos;&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN person_name pn ON p.patient_id = pn.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr ON p.patient_id = zlemr.patient_id AND zlemr.identifier_type = 14 AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN (SELECT patient_id, DATE(encounter_datetime) dt FROM encounter WHERE encounter_type = 19 AND voided = 0 &#xd;\nAND encounter_datetime BETWEEN :startDate AND ADDDATE(:endDate,1) AND location_id = :location &#xd;\nGROUP BY patient_id, DATE(encounter_datetime)) up ON p.patient_id = up.patient_id&#xd;\n&#xd;\nLEFT OUTER JOIN encounter dx ON p.patient_id = dx.patient_id AND dx.encounter_type = 19 AND DATE(dx.encounter_datetime) = up.dt AND dx.voided = 0&#xd;\n&#xd;\n-- coded diagnosis 1&#xd;\nLEFT OUTER JOIN obs cd1 ON dx.encounter_id = cd1.encounter_id AND cd1.concept_id = 6542 AND cd1.voided = 0&#xd;\nLEFT OUTER JOIN concept_name cd1n ON cd1.value_coded = cd1n.concept_id AND cd1n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd2 ON dx.encounter_id = cd2.encounter_id AND cd2.concept_id = 6542 AND cd2.voided = 0 AND cd2.obs_id != cd1.obs_id&#xd;\nLEFT OUTER JOIN concept_name cd2n ON cd2.value_coded = cd2n.concept_id AND cd2n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd3 ON dx.encounter_id = cd3.encounter_id AND cd3.concept_id = 6542 AND cd3.voided = 0 AND cd3.obs_id NOT IN (cd1.obs_id, cd2.obs_id)&#xd;\nLEFT OUTER JOIN concept_name cd3n ON cd3.value_coded = cd3n.concept_id AND cd3n.locale = &apos;fr&apos;&#xd;\n&#xd;\n-- uncoded diagnosis 1 - 3&#xd;\nLEFT OUTER JOIN obs nc1 ON dx.encounter_id = nc1.encounter_id AND nc1.concept_id = 6543 AND nc1.voided = 0&#xd;\nLEFT OUTER JOIN obs nc2 ON dx.encounter_id = nc2.encounter_id AND nc2.concept_id = 6543 AND nc2.voided = 0 AND nc2.obs_id != nc1.obs_id&#xd;\nLEFT OUTER JOIN obs nc3 ON dx.encounter_id = nc3.encounter_id AND nc3.concept_id = 6543 AND nc3.voided = 0 AND nc3.obs_id NOT IN (nc1.obs_id, nc2.obs_id)&#xd;\n&#xd;\n-- mobile clinic location&#xd;\nLEFT OUTER JOIN obs mobile_loc ON dx.encounter_id = mobile_loc.encounter_id AND mobile_loc.concept_id = 6767 AND mobile_loc.voided = 0&#xd;\n&#xd;\n-- gps coordinates&#xd;\nLEFT OUTER JOIN obs gps ON dx.encounter_id = gps.encounter_id AND gps.concept_id = 6772 AND gps.voided = 0&#xd;\n&#xd;\n-- pregnant&#xd;\nLEFT OUTER JOIN obs pregnant ON dx.encounter_id = pregnant.encounter_id AND pregnant.concept_id = 6761 AND pregnant.voided = 0&#xd;\nLEFT OUTER JOIN concept_name pregnant_n ON pregnant.value_coded = pregnant_n.concept_id AND pregnant_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- MUAC&#xd;\nLEFT OUTER JOIN obs muac ON dx.encounter_id = muac.encounter_id AND muac.concept_id = 6766 AND muac.voided = 0&#xd;\nLEFT OUTER JOIN concept_name muac_n ON muac.value_coded = muac_n.concept_id AND muac_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- coughing 2 weeks&#xd;\nLEFT OUTER JOIN obs cough ON dx.encounter_id = cough.encounter_id AND cough.concept_id = 6744 AND cough.voided = 0&#xd;\nLEFT OUTER JOIN concept_name cough_n ON cough.value_coded = cough_n.concept_id AND cough_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- fever&#xd;\nLEFT OUTER JOIN obs fever ON dx.encounter_id = fever.encounter_id AND fever.concept_id = 6745 AND fever.voided = 0&#xd;\nLEFT OUTER JOIN concept_name fever_n ON fever.value_coded = fever_n.concept_id AND fever_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- sweat&#xd;\nLEFT OUTER JOIN obs sweat ON dx.encounter_id = sweat.encounter_id AND sweat.concept_id = 6746 AND sweat.voided = 0&#xd;\nLEFT OUTER JOIN concept_name sweat_n ON sweat.value_coded = sweat_n.concept_id AND sweat_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- weight&#xd;\nLEFT OUTER JOIN obs weight ON dx.encounter_id = weight.encounter_id AND weight.concept_id = 6747 AND weight.voided = 0&#xd;\nLEFT OUTER JOIN concept_name weight_n ON weight.value_coded = weight_n.concept_id AND weight_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- tb&#xd;\nLEFT OUTER JOIN obs tb ON dx.encounter_id = tb.encounter_id AND tb.concept_id = 6748 AND tb.voided = 0&#xd;\nLEFT OUTER JOIN concept_name tb_n ON tb.value_coded = tb_n.concept_id AND tb_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- hiv test&#xd;\nLEFT OUTER JOIN obs hiv ON dx.encounter_id = hiv.encounter_id AND hiv.concept_id = 6762 AND hiv.voided = 0&#xd;\nLEFT OUTER JOIN concept_name hiv_n ON hiv.value_coded = hiv_n.concept_id AND hiv_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- hiv test result&#xd;\nLEFT OUTER JOIN obs hiv_r ON dx.encounter_id = hiv_r.encounter_id AND hiv_r.concept_id = 3753 AND hiv_r.voided = 0&#xd;\nLEFT OUTER JOIN concept_name hiv_r_n ON hiv_r.value_coded = hiv_r_n.concept_id AND hiv_r_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- referral&#xd;\nLEFT OUTER JOIN obs referral ON dx.encounter_id = referral.encounter_id AND referral.concept_id = 6750 AND referral.voided = 0&#xd;\nLEFT OUTER JOIN concept_name referral_n ON referral.value_coded = referral_n.concept_id AND referral_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- referral loc&#xd;\nLEFT OUTER JOIN obs referral_loc ON dx.encounter_id = referral_loc.encounter_id AND referral_loc.concept_id = 6794 AND referral_loc.voided = 0&#xd;\nLEFT OUTER JOIN location referral_loc_loc ON CAST(referral_loc.value_text AS unsigned) = referral_loc_loc.location_id&#xd;\n&#xd;\n-- emergency transport&#xd;\nLEFT OUTER JOIN obs trans ON dx.encounter_id = trans.encounter_id AND trans.concept_id = 6749 AND trans.voided = 0&#xd;\nLEFT OUTER JOIN concept_name trans_n ON trans.value_coded = trans_n.concept_id AND trans_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- referral reason&#xd;\nLEFT OUTER JOIN obs reason ON dx.encounter_id = reason.encounter_id AND reason.concept_id = 6760 AND reason.voided = 0&#xd;\nLEFT OUTER JOIN concept_name reason_n ON reason.value_coded = reason_n.concept_id AND reason_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- provider&#xd;\nLEFT OUTER JOIN encounter_provider enc_prov ON dx.encounter_id = enc_prov.encounter_id AND enc_prov.voided = 0&#xd;\nLEFT OUTER JOIN provider prov ON enc_prov.provider_id = prov.provider_id AND prov.retired = 0&#xd;\nLEFT OUTER JOIN person_name prov_name ON prov.person_id = prov_name.person_id AND prov_name.voided = 0&#xd;\n&#xd;\nINNER JOIN location loc ON dx.location_id = loc.location_id&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id, up.dt;&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-03-21 22:12:19',1,'2013-03-23 15:10:54',3,0,NULL,NULL,NULL,'e372d890-d4ef-4f88-b641-e90ce3f9efaf'),(268,'_Patient visit summary','for Mobile Clinics','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"036364e4-015f-44af-9b1a-92325cb319f8\" retired=\"false\">\n  <name>_Patient visit summary</name>\n  <description>for Mobile Clinics</description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-21 22:13:07 CET</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2013-03-21 22:13:48 CET</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>268</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"e372d890-d4ef-4f88-b641-e90ce3f9efaf\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-03-21 22:13:07',1,'2013-03-21 22:13:48',1,0,NULL,NULL,NULL,'036364e4-015f-44af-9b1a-92325cb319f8'),(270,'_Mobile Clinic Referral Tracking','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"4258efb7-f67c-4757-9458-bf108fa0b5eb\" retired=\"false\">\n  <name>_Mobile Clinic Referral Tracking</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-22 13:36:51 CET</dateCreated>\n  <changedBy id=\"4\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"5\">2013-04-03 10:35:57 CEST</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>270</id>\n  <sqlQuery>SELECT &#xd;\n  loc.name as Site,&#xd;\n  DATE(dx.encounter_datetime) AS &apos;Date of Mobile Clinic&apos;,&#xd;\n  mobile_loc.value_text as &apos;Location of Mobile Clinic&apos;,&#xd;\n  gps.value_text as &apos;GPS Coordinates&apos;,&#xd;\n  p.patient_id as &apos;Patient Id (internal)&apos;,&#xd;\n  zlemr.identifier AS &apos;Mobile Clinic Id&apos;,&#xd;\n  pn.given_name AS FirstName,&#xd;\n  pn.family_name AS LastName,&#xd;\n  pr.gender AS Gender,&#xd;\n  ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &apos;Age At Visit&apos;, &#xd;\n  IF(ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &gt; 14, &apos;1&apos;, &apos;0&apos;) &apos;15 and older&apos;, &#xd;\n  IF(ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &lt; 15, &apos;1&apos;, &apos;0&apos;) &apos;Under 15&apos;, &#xd;\n  a.state_province Departement, a.city_village Commune, a.address3 &apos;Section communale&apos;, a.address1 Locality,&#xd;\n  &apos;source N/A&apos;,&#xd;\n  &apos;TODO: sectionID&apos;,&#xd;\n  (SELECT GROUP_CONCAT(value_text SEPARATOR &apos;, &apos;) FROM obs WHERE encounter_id=dx.encounter_id AND concept_id IN (6768, 6770, 6771)) AS &apos;CHW names&apos;,&#xd;\n  (SELECT GROUP_CONCAT(value_text SEPARATOR &apos;, &apos;) FROM obs WHERE encounter_id=dx.encounter_id AND concept_id IN (6769, 6795)) AS &apos;NEC names&apos;,&#xd;\n  referral_loc_loc.name AS &apos;Referral Institution&apos;,&#xd;\n  reason_n.name AS &apos;Reason for Referral&apos;,&#xd;\n  DATE(conf_tb_date.value_datetime) AS &apos;Date of confirmative TB diagnosis&apos;,&#xd;\n  (SELECT DATE(e.encounter_datetime) FROM encounter e, obs o WHERE p.patient_id = e.patient_id AND e.encounter_type = 20 AND DATE(e.encounter_datetime) &gt;= up.dt AND e.voided = 0 AND o.encounter_id = e.encounter_id AND o.concept_id = 6760 AND o.voided = 0 AND o.value_coded = reason.value_coded LIMIT 1) AS &apos;Date of enrollment&apos;,&#xd;\n  (SELECT DATE(e.encounter_datetime) FROM encounter e, obs o WHERE p.patient_id = e.patient_id AND e.encounter_type = 19 AND DATE(e.encounter_datetime) &gt; up.dt AND e.voided = 0 LIMIT 1) AS &apos;Date of subsequent Mobile Clinic visit&apos;&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN person_name pn ON p.patient_id = pn.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr ON p.patient_id = zlemr.patient_id AND zlemr.identifier_type = 14 AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN (SELECT patient_id, DATE(encounter_datetime) dt FROM encounter WHERE encounter_type = 19 AND voided = 0 AND encounter_datetime BETWEEN :startDate AND ADDDATE(:endDate,1) AND location_id = :location &#xd;\nGROUP BY patient_id, DATE(encounter_datetime)) up ON p.patient_id = up.patient_id&#xd;\n&#xd;\n-- consultation encounter&#xd;\nLEFT OUTER JOIN encounter dx ON p.patient_id = dx.patient_id AND dx.encounter_type = 19 AND DATE(dx.encounter_datetime) = up.dt AND dx.voided = 0&#xd;\n&#xd;\n-- mobile clinic location&#xd;\nLEFT OUTER JOIN obs mobile_loc ON dx.encounter_id = mobile_loc.encounter_id AND mobile_loc.concept_id = 6767 AND mobile_loc.voided = 0&#xd;\n&#xd;\n-- gps coordinates&#xd;\nLEFT OUTER JOIN obs gps ON dx.encounter_id = gps.encounter_id AND gps.concept_id = 6772 AND gps.voided = 0&#xd;\n&#xd;\n-- referral loc&#xd;\nLEFT OUTER JOIN obs referral_loc ON dx.encounter_id = referral_loc.encounter_id AND referral_loc.concept_id = 6794 AND referral_loc.voided = 0&#xd;\nLEFT OUTER JOIN location referral_loc_loc ON CAST(referral_loc.value_text AS unsigned) = referral_loc_loc.location_id&#xd;\n&#xd;\n-- referral reason HIV, TB or Malnutrition&#xd;\nINNER JOIN obs reason ON dx.encounter_id = reason.encounter_id AND reason.concept_id = 6760 AND reason.voided = 0 AND reason.value_coded IN (6751, 6752, 6753)&#xd;\nLEFT OUTER JOIN concept_name reason_n ON reason.value_coded = reason_n.concept_id AND reason_n.locale = &apos;en&apos;&#xd;\n&#xd;\n-- confirmative tb result&#xd;\nLEFT OUTER JOIN encounter tb ON p.patient_id = tb.patient_id AND tb.encounter_type = 21 AND DATE(tb.encounter_datetime) &gt;= up.dt AND tb.voided = 0 AND reason.value_coded=6752&#xd;\nLEFT OUTER JOIN obs conf_tb ON tb.encounter_id = conf_tb.encounter_id AND conf_tb.concept_id = 6782 AND conf_tb.value_coded=703 AND conf_tb.voided = 0&#xd;\nLEFT OUTER JOIN obs conf_tb_date ON conf_tb.encounter_id = conf_tb_date.encounter_id AND conf_tb_date.concept_id = 6786 AND conf_tb_date.voided = 0&#xd;\n&#xd;\n-- enrollment&#xd;\nLEFT OUTER JOIN encounter enrol ON p.patient_id = enrol.patient_id AND enrol.encounter_type = 20 AND DATE(enrol.encounter_datetime) &gt;= up.dt AND enrol.voided = 0&#xd;\nLEFT OUTER JOIN obs enrol_reason ON enrol.encounter_id = enrol_reason.encounter_id AND enrol_reason.concept_id = 6760 AND enrol_reason.voided = 0 AND enrol_reason.value_coded = reason.value_coded&#xd;\n&#xd;\nINNER JOIN location loc ON dx.location_id = loc.location_id&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id, up.dt, reason.obs_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-03-22 13:36:51',1,'2013-04-03 10:35:57',3,0,NULL,NULL,NULL,'4258efb7-f67c-4757-9458-bf108fa0b5eb'),(271,'_Mobile Clinic Referral Tracking','for HIV, TB, Malnutrition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"b9d598bc-299e-440c-82ae-6f2b0278d274\" retired=\"false\">\n  <name>_Mobile Clinic Referral Tracking</name>\n  <description>for HIV, TB, Malnutrition</description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-22 13:39:25 CET</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2013-03-22 13:40:04 CET</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>271</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"4258efb7-f67c-4757-9458-bf108fa0b5eb\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-03-22 13:39:25',1,'2013-03-22 13:40:04',1,0,NULL,NULL,NULL,'b9d598bc-299e-440c-82ae-6f2b0278d274'),(272,'_NEC follow up of community based TB results','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"f5d01f40-cfb7-4fb2-baa6-b2971c0cde1b\" retired=\"false\">\n  <name>_NEC follow up of community based TB results</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-23 00:08:05 CET</dateCreated>\n  <changedBy id=\"4\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"5\">2013-04-03 10:37:47 CEST</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>272</id>\n  <sqlQuery>SELECT &#xd;\n  loc.name as Site,&#xd;\n  DATE(dx.encounter_datetime) AS &apos;Date of Mobile Clinic&apos;,&#xd;\n  mobile_loc.value_text as &apos;Location of Mobile Clinic&apos;,&#xd;\n  (SELECT GROUP_CONCAT(value_text SEPARATOR &apos;, &apos;) FROM obs WHERE encounter_id=dx.encounter_id AND concept_id IN (6768, 6770, 6771)) AS &apos;CHW names&apos;,&#xd;\n  (SELECT GROUP_CONCAT(value_text SEPARATOR &apos;, &apos;) FROM obs WHERE encounter_id=dx.encounter_id AND concept_id IN (6769, 6795)) AS &apos;NEC names&apos;,&#xd;\n  zlemr.identifier AS &apos;Mobile Clinic Id&apos;,&#xd;\n  pn.given_name AS FirstName,&#xd;\n  pn.family_name AS LastName,&#xd;\n  pr.gender AS Gender,&#xd;\n  ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) &apos;Age At Visit&apos;, &#xd;\n  -- a.state_province Departement, a.city_village Commune, a.address3 &apos;Section communale&apos;, &#xd;\n  a.address1 Locality,&#xd;\n  CASE &#xd;\n    (SELECT o.concept_id FROM encounter e, obs o&#xd;\n       WHERE p.patient_id = e.patient_id AND e.encounter_type = 21 AND o.encounter_id = e.encounter_id&#xd;\n         AND o.voided=0 and e.voided=0&#xd;\n         AND DATE(e.encounter_datetime) &gt;= up.dt AND o.concept_id IN (6787, 6777) LIMIT 1)&#xd;\n     WHEN 6777 THEN &apos;sputum&apos;&#xd;\n     WHEN 6787 THEN &apos;ppd&apos;&#xd;\n   END&#xd;\n   AS &apos;tb test type&apos;,&#xd;\n   (SELECT cn.name FROM encounter e, obs o, concept_name cn &#xd;\n     WHERE p.patient_id = e.patient_id AND e.encounter_type = 21 AND o.encounter_id = e.encounter_id AND o.value_coded = cn.concept_id&#xd;\n       AND o.voided=0 and e.voided=0 and cn.voided=0&#xd;\n       AND DATE(e.encounter_datetime) &gt;= up.dt AND o.concept_id = 6777 LIMIT 1)&#xd;\n   AS &apos;first sputum result&apos;,&#xd;\n   (SELECT cn.name FROM encounter e, obs o, concept_name cn &#xd;\n     WHERE p.patient_id = e.patient_id AND e.encounter_type = 21 AND o.encounter_id = e.encounter_id AND o.value_coded = cn.concept_id&#xd;\n       AND o.voided=0 and e.voided=0 and cn.voided=0&#xd;\n       AND DATE(e.encounter_datetime) &gt;= up.dt AND o.concept_id = 6787 LIMIT 1)&#xd;\n   AS &apos;ppd result&apos;,&#xd;\n  &apos;Wi / Non&apos; AS &apos;patient present for follow up? (circle one)&apos;&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN person_name pn ON p.patient_id = pn.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr ON p.patient_id = zlemr.patient_id AND zlemr.identifier_type = 14 AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN (SELECT patient_id, DATE(encounter_datetime) dt FROM encounter WHERE encounter_type = 19 AND voided = 0 AND encounter_datetime BETWEEN :startDate AND ADDDATE(:endDate,1) AND location_id = :location &#xd;\nGROUP BY patient_id, DATE(encounter_datetime)) up ON p.patient_id = up.patient_id&#xd;\n&#xd;\n-- consultation encounter&#xd;\nLEFT OUTER JOIN encounter dx ON p.patient_id = dx.patient_id AND dx.encounter_type = 19 AND DATE(dx.encounter_datetime) = up.dt AND dx.voided = 0&#xd;\n&#xd;\n-- mobile clinic location&#xd;\nLEFT OUTER JOIN obs mobile_loc ON dx.encounter_id = mobile_loc.encounter_id AND mobile_loc.concept_id = 6767 AND mobile_loc.voided = 0&#xd;\n&#xd;\n-- only TB referrals&#xd;\nINNER JOIN obs reason ON dx.encounter_id = reason.encounter_id AND reason.concept_id = 6760 AND reason.voided = 0 AND reason.value_coded = 6752&#xd;\n&#xd;\nINNER JOIN location loc ON dx.location_id = loc.location_id&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id, up.dt;&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-03-23 00:08:05',1,'2013-04-03 10:37:47',3,0,NULL,NULL,NULL,'f5d01f40-cfb7-4fb2-baa6-b2971c0cde1b'),(273,'_NEC follow up of community based TB results','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"8f8c31df-2f31-45cd-acf4-1f6151d593e2\" retired=\"false\">\n  <name>_NEC follow up of community based TB results</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-23 00:09:35 CET</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2013-03-23 00:10:16 CET</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>273</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"f5d01f40-cfb7-4fb2-baa6-b2971c0cde1b\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-03-23 00:09:35',1,'2013-03-23 00:10:16',1,0,NULL,NULL,NULL,'8f8c31df-2f31-45cd-acf4-1f6151d593e2'),(274,'_Mobile Clinic Overview','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"4776347e-ff4f-4190-8ef7-140633861d6b\" retired=\"false\">\n  <name>_Mobile Clinic Overview</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateCreated id=\"3\">2013-03-23 13:55:43 CET</dateCreated>\n  <changedBy id=\"4\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"5\">2013-04-03 10:34:18 CEST</dateChanged>\n  <parameters id=\"6\"/>\n  <id>274</id>\n  <sqlQuery>SELECT &#xd;\n  loc.name as Site,&#xd;\n  DATE(dx.encounter_datetime) AS &apos;Date of Mobile Clinic&apos;,&#xd;\n  mobile_loc.value_text as &apos;Location of Mobile Clinic&apos;,&#xd;\n  gps.value_text as &apos;GPS coordinates&apos;,&#xd;\n  (SELECT GROUP_CONCAT(value_text SEPARATOR &apos;, &apos;) FROM obs WHERE encounter_id=dx.encounter_id AND concept_id IN (6768, 6770, 6771)) AS &apos;CHW names&apos;,&#xd;\n  (SELECT GROUP_CONCAT(value_text SEPARATOR &apos;, &apos;) FROM obs WHERE encounter_id=dx.encounter_id AND concept_id IN (6769, 6795)) AS &apos;NEC names&apos;,&#xd;\n  count(*) AS &apos;consultation count&apos;&#xd;\n  &#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN (SELECT patient_id, DATE(encounter_datetime) dt FROM encounter WHERE encounter_type = 19 AND voided = 0&#xd;\n-- AND encounter_datetime BETWEEN startDateParameter AND ADDDATE(endDateParameter,1) AND location_id = locationParameter &#xd;\nGROUP BY patient_id, DATE(encounter_datetime)) up ON p.patient_id = up.patient_id&#xd;\n&#xd;\n-- consultation encounter&#xd;\nLEFT OUTER JOIN encounter dx ON p.patient_id = dx.patient_id AND dx.encounter_type = 19 AND DATE(dx.encounter_datetime) = up.dt AND dx.voided = 0&#xd;\n&#xd;\n-- mobile clinic location&#xd;\nLEFT OUTER JOIN obs mobile_loc ON dx.encounter_id = mobile_loc.encounter_id AND mobile_loc.concept_id = 6767 AND mobile_loc.voided = 0&#xd;\n&#xd;\n-- gps coordinates&#xd;\nLEFT OUTER JOIN obs gps ON dx.encounter_id = gps.encounter_id AND gps.concept_id = 6772 AND gps.voided = 0&#xd;\n&#xd;\nINNER JOIN location loc ON dx.location_id = loc.location_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY mobile_loc.value_text, up.dt;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-03-23 13:55:43',1,'2013-04-03 10:34:18',3,0,NULL,NULL,NULL,'4776347e-ff4f-4190-8ef7-140633861d6b'),(275,'_Mobile Clinic Overview','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"49d6f4f3-c6ca-4294-9a8e-c8833bd066f9\" retired=\"false\">\n